(39, 1, '2021-07-06 05:49:15', '2021-07-06 05:49:15', '<img width=\"4032\" height=\"3024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/patrick-tomasso-GXXYkSwndP4-unsplash.jpg\" alt=\"\" loading=\"lazy\" />															\n			<h4>About Us</h4>		\n		<p>Al CaFinest is letting you in to our home which could also be your second home. We promise you that our place will be your favorite place once you experience the homie feel and a service like a family. We are here to give you comfort and joy with our coffee that has always the finest taste.</p><p>Al cafinest</p>		\n			<h3>Our kind of hot coffee</h3>		\n															<img width=\"683\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/devin-avery-5iRgh_G0eRY-unsplash-1.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"768\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/alisa-anton-FbRGK2rZs8g-unsplash-1.jpg\" alt=\"\" loading=\"lazy\" />															\n		<p>When my blood runs black as the moonless night, and my heartbeat sounds as the warrior\'s march, only then may you say, Ive had enough coffee.</p>		\n															<img width=\"683\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/snapbythree-my-g6e641CiHFQ-unsplash-1.jpg\" alt=\"\" loading=\"lazy\" />															\n		<p>al cafinest</p>		\n			<h3>A piece of bread is enough for your coffee</h3>		\n															<img width=\"1024\" height=\"880\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/louis-hansel-xSJ1mizngqs-unsplash.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"769\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/ben-kolde-Z02YMhhW-gY-unsplash-1.jpg\" alt=\"\" loading=\"lazy\" />															\n		<p>I judge a restaurant by the bread and the coffee.</p>		\n															<img width=\"683\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/nathan-dumlao-YwhzwOA3RHY-unsplash.jpg\" alt=\"\" loading=\"lazy\" />															\n		<p>al cafinest</p>		\n			<h3>Iced coffee is always a good idea</h3>		\n															<img width=\"681\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/jorik-blom-HP4VFH70LMc-unsplash-1.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"1024\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/ryan-de-hamer-pdTpTjV48_w-unsplash.jpg\" alt=\"\" loading=\"lazy\" />															\n		<p>Don\'t let anyone tell you it\'s too cold for iced coffee.</p>		\n															<img width=\"738\" height=\"1024\" src=\"https://localhost/Wordpress/wp-content/uploads/2021/07/tabitha-turner-F0Wd4djYvSA-unsplash-1.jpg\" alt=\"\" loading=\"lazy\" />', 'About Us', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2021-07-11 12:58:08', '2021-07-11 12:58:08', '', 0, 'https://localhost/Wordpress/?page_id=39', 0, 'page', '', 0),
