(41, 1, '2021-07-06 05:52:09', '2021-07-06 05:52:09', '<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=Santa%20Rosa%20City%2C%20Laguna%2C%20Philippines&amp;t=m&amp;z=18&amp;output=embed&amp;iwloc=near\" title=\"%3$s\" aria-label=\"%3$s\"></iframe>\n			<h6>Location</h6>		\n		<p>Santa Rosa City, Laguna, 4026, Philippines</p>		\n			<h6>Our hours</h6>		\n		<p>10:00 AM - 10:00 PM<br />Monday - Sunday</p>		\n			<h6>Contact us</h6>		\n		<p>Phone: 0998 4571 913<br />Email: info.alcafinest.ph@gmail.com</p>		\n					<a target=\"_blank\" rel=\"noopener\">\n						Facebook-f\n											</a>\n					<a target=\"_blank\" rel=\"noopener\">\n						Twitter\n											</a>\n					<a target=\"_blank\" rel=\"noopener\">\n						Google-plus-g\n											</a>\n					<a target=\"_blank\" rel=\"noopener\">\n						Instagram\n											</a>\n					<a target=\"_blank\" rel=\"noopener\">\n						Dribbble\n											</a>\n					<a target=\"_blank\" rel=\"noopener\">\n						Youtube\n											</a>', 'Contacts', '', 'publish', 'closed', 'closed', '', 'contacts', '', '', '2021-07-10 15:55:43', '2021-07-10 15:55:43', '', 0, 'https://localhost/Wordpress/?page_id=41', 0, 'page', '', 0),
